import React from 'react';
// import Navbar from '../Components/Navbar';
// import Sidebar from '../Components/Sidebar';
import DashboardBody from '../components/dashboard-components/DashboardBody';
import DashboardLayout from '../layout/dashboard-layout';
import Dashboardaddvenue from '../components/dashboard-components/Dashboard-add-venue';
export default function Dashboard() {
  const handleVenues="dashboard";
  // const handleVenues="kids&Single-venues";
  // const handleVenues="resturent";
  // const handleVenues="multivenues";
  return (
    <>
      <DashboardLayout>
        <div className="flex">
         <div className="flex-1">
          <DashboardBody handleVenues={handleVenues}/>
          {/* <Dashboardaddvenue handleVenues={handleVenues}/> */}
        </div>
      </div>
      </DashboardLayout>
    </>
  );
}
